'use client'
import { useMobile } from "@/hooks/useMobile"
import { useRouter } from "next/navigation"
import * as React from "react"

interface Props {

  setRegion: React.Dispatch<React.SetStateAction<string>>
  setVisible: React.Dispatch<React.SetStateAction<boolean>>
  allowedRegions: string[]
}


function filterRegion(currentRegion: string, allowedRegions: string[]) {
  return allowedRegions.includes(currentRegion)

}
function capitalizeString(str: string): string {
  // Maneja el caso de que el string esté vacío o sea nulo.

  // Obtiene la primera letra y la convierte a mayúscula.
  const firstChar = str.charAt(0).toUpperCase();

  // Obtiene el resto del string, sin la primera letra.
  const restOfString = str.slice(1).toLowerCase();
  // Combina la primera letra capitalizada con el resto del string.
  console.log(firstChar)
  return firstChar + restOfString;
}



