  const RouterDestinoURL = (ciudad: string) => {
    // Usa router.push para navegar a la página '/about'
    if (filterRegion(ciudad, allowedRegions)) {
      router.push(`/tours?destination=${capitalizeString(ciudad)}&categories=`);
    }
  }
